import React from "react";
import Header from "./Mycomponentss/Header";
import Todos from "./Mycomponentss/Todos";
import Footer from "./Mycomponentss/Footer";
import "./index.css";
function App(){
    return(
        <>
            <Header title="preksha app"/>
            <Todos/>
            <Footer/>
        </>
    );
}
export default App;
